def identify_spec_state(sentence):
    spec = []
    state = []
    state_name = ""
    spec_name = ""
    for word in sentence.split():
        state_name = search_in_list(word,state_list)
        spec_name = search_in_list(word,spec_list)
        if(state_name is not None):
            state.append(State_dic.get(state_name))
        if (spec_name is not None):
            spec.append(spec_name)
    return spec, state





